import React, { useState, useEffect, useContext } from "react";
import { Headercontext } from "../Headerdata/HeaderData";
import { ToastContainer } from "react-toastify";
import "react-toastify/dist/ReactToastify.css";
import Layout from "../layout";
import Innerlayout from "../layout/Innerlayout";
import Inputbox from "../common/Inputbox";
import Button from "../common/Button";
const Verifycode = () => {
  return (
    <Layout>
      <Innerlayout heading={"Verify Email"} subheading="">
        <p>An email with a verification link will be sent to your email address for confirmation.</p>
        <Inputbox type="email" placeholder="Email*" required />
        <Button action={"Send Link"}/>

      </Innerlayout>
    </Layout>
  );
};

export default Verifycode;
